import "./Team.css";

const Team = (props) => {
  const { primaryColor, secondaryColor } = props.data;
  return (
    <section
      className="team"
      style={{ backgroundColor: props.data.secondaryColor }}
    >
      {" "}
      <h3 style={{ borderColor: props.data.primaryColor }}>
        {props.data.title}
      </h3>{" "}
      <div className="collaborators">{props.team}</div>
    </section>
  );
};

export default Team;
